import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.css';
import Header from './components/Heaeder';
import NotesListPage from './pages/NotesListPage'

function App() {
  return (
    <Router>
      <Routes>
        <div className="App">
          <Header />
          <Route path="/" exact component={NotesListPage} />   
        </div>
      </Routes>
    </Router>
  );
}

export default App;
